import React, { FunctionComponent } from "react";
import { AppBar, Toolbar } from "@material-ui/core";
import LeftDrawer from "./LeftDrawer"

const Header: FunctionComponent = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <LeftDrawer />
      </Toolbar>
    </AppBar>
  );
};
export default Header;
